#!/bin/bash

bayes_net () {
	curl --silent --output /dev/null -X POST "http://$1:8080/algorithm/NaiveBayes" -H "accept: text/uri-list" -H "Content-Type: multipart/form-data" -F "datasetUri=" -F "batchSize=100" -F "useKernelEstimator=0" -F "useSupervisedDiscretization=1" -F "validation=CrossValidation" -F "validationNum=10" -F "file=@breast-cancer.arff"
}

decision_stump () {
	curl --silent --output /dev/null -X POST "http://$1:8080/algorithm/DecisionStump" -H "accept: text/uri-list" -H "Content-Type: multipart/form-data" -F "datasetUri=" -F "validation=CrossValidation" -F "validationNum=10" -F "file=$2"
}

simple_k_means () {
	curl --silent --output /dev/null -X POST "http://$1:8080/cluster/SimpleKMeans" -H "accept: text/x-arff" -H "Content-Type: multipart/form-data" -F "initializationMethod=" -F "numExecutionSlots=" -F "canopyPeriodicPruningRate=" -F "dontReplaceMissingValues=" -F "canopyT1=" -F "canopyT2=" -F "fastDistanceCalc=" -F "distanceFunction=" -F "canopyMaxNumCanopiesToHoldInMemory=" -F "reduceNumberOfDistanceCalcsViaCanopies=" -F "seed=" -F "datasetUri=" -F "maxIterations=" -F "canopyMinimumCanopyDensity=" -F "preserveInstancesOrder=" -F "file=$2" -F "displayStdDevs=" -F "numClusters="
}

START=1
END=$1
FILE=''
echo 'start'
for i in $(seq $START $END)
do
    case $2 in
	'b')
		bayes_net $3 
		;;
	'd')
		decision_stump $3 
		;;
	'k')
		simple_k_means $3 
		;;
	esac
done
echo All done
